Greatest Hits is a compilation album by the American rock band Guns N' Roses, released on March 23, (2004).
Released by Geffen in part because of the delay in the making of Chinese Democracy, 
the album is subject to lawsuits by band member Axl Rose and former band members
in an attempt to block its release due to its track listing Despite the album having almost no promotion
it reached number one on the UK Albums Chart and number three on the Billboard 200 chart upon its release.
Greatest Hits re-entered the Billboard 200 at number three in March 2012, selling about 85,000 copies as part of a promotion by 
both Amazon MP3 and Google Play that saw the album sold for 25 cents for one day.
The album has proven a popular seller, selling over 5.2 million copies in the United States, as of 2012.
